import React from "react"
import {Text,StyleSheet} from "react-native"
const HomeScreen=()=>{
    return(
    <view>
        <Text style={StyleSheet.textStyle}>HomeScreen</Text>
    </view>    
    )
}

const styles =StyleSheet.create({
    textStyle:{
        fontSize:30,
        color: "blue",
    },
})

export default HomeScreen
